import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "../Styles/seed.css";
import { Pagination } from "swiper";
import ContentBox from "../components/contentBox";
import MapaMundi from "../assets/images/mapamundi.svg";


export default function Services(props) {
    const { children } = props;

    return (
        <>
        
        <Swiper 
        direction={"vertical"}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper w-100 h-100 h-pr-fl-ma b-s-b-b bg-orange"
      >
       
            
        <SwiperSlide className="bg-red"><img
          className="w-100 h-100 bg-blue h-pr-fl-ma " Style="object-fit: cover;"
          
          src={MapaMundi}
            
       
        />
         </SwiperSlide >
        <SwiperSlide className="bg-skyblue"><div className="w-100 h-100 h-pr-fl-ma">
                    <div className="m-w-100 w-50 h-100 h-pr-fl-ma bg-red"></div>
