        <SwiperSlide className="bg-red">Slide 6</SwiperSlide>
        <SwiperSlide className="bg-red">Slide 7</SwiperSlide>
        <SwiperSlide className="bg-red">Slide 8</SwiperSlide>
        <SwiperSlide className="bg-red">Slide 9</SwiperSlide>
     
  
      
      </Swiper>



