                        <ContentBox link={"enlace accion"} className="w-100 h-a r-v-c" title={"Asesoría"} subtitle={"Solo le enseñamos su potencial."} text={"Un grupo de expertos le asesorarán en lo que usted necesita para lograr todas sus metas.\u00A0  Este servicio es exclusivo para miembros del club GOLD.\u00A0   \u00A0 "}   action={"Click aquí para saber más sobre este servicio."}  /></div>
