                    <div  className="m-w-100 w-50 h-50 h-pr-fl-ma b-s-b-b p-r p-20px">
                        <ContentBox link={"enlace accion"} className=" w-100 h-a r-v-c" title={"Gestión comercial"} subtitle={"La tecnología de su lado."} text={"Ofrecemos su propio espacio digital, \u00A0 actualizado  con las mejores tecnologías del mercado, un kit específico para ser la envídia de su competencia.\u00A0    \u00A0 "}   action={"Click aquí para saber más sobre este servicio."}  /></div>


                </div>
                {children}
            </div>
        </>
    );
}
